
CREATE SCHEMA data_db;
CREATE SCHEMA api_db;

create table data_db.products (
    product_id  varchar(20) not null primary key,
    category_id varchar(20) not null
);

create table data_db.orders (
    order_id    bigint not null primary key,
    user_id     varchar(20) not null,
    order_date  timestamp not null
);

create table data_db.order_items (
    id          bigint not null primary key,
    order_id    bigint not null,
    product_id  varchar(20) not null,
    quantity    int not null,
    CONSTRAINT fk_orders FOREIGN KEY(order_id) REFERENCES data_db.orders(order_id),
    CONSTRAINT fk_products FOREIGN KEY(product_id) REFERENCES data_db.products(product_id)
);

create table api_db.product_visits (
    user_id     varchar(20) not null,
    product_id  varchar(20) not null,
    visit_date  timestamp not null,
    PRIMARY KEY(user_id, product_id)
);

CREATE INDEX ix_product_visits_user_id_visit_date ON api_db.product_visits (user_id, visit_date desc);

create table api_db.product_sales (
    product_id   varchar(20) not null primary key,
    category_id  varchar(20) not null,
    user_count   integer not null
);

CREATE INDEX ix_product_sales_category ON api_db.product_sales (category_id);








